Falar de libertadores torcendo para o galo é ser muito burro. O teu rival mesmo quase morto tem 2 libertadores, chegou em 4 finais, disputou a libertadores de maneira seguida quase 15 anos, tem umas 30 participações, enquanto o Galo tem umas 6, teu time ganhou um título só e depois de 30 anos que o rival ganhou. 

O Cruzeiro se fechar hoje o Galo vai precisar ganhar tudo por uns 10 anos só para empatar com eles. O que convenhámos para o galo que tem uma média de título a cada quase 40 anos é impossível.

 @eumesmodasadabetim  

Nem torço para o Athletico ou cruzeiro, mas, eu, e quase 100% das pessoas em SP não consideramos o Galo um clube "grande", aqui todo mundo sabe que o cruzeiro é ou foi grande, e que o galo é um clube quase do tamanho do Coritiba ou Atthletico PR. O Galo até pouco tempo só tinha um título, ficou mais de 100 anos com um título só. Até o botafogo ganhou o bi do brasileiro e vocês não.

Eu teria vergonha de saber que o meu rival ganhou 4 brasileiros, 6 cps do Brasil, 2 libertadores, recopa, e o meu time venceu em mais de 100 anos 1 br, 1 cp e uma libertadores.

